svg.script:

function getRandomColor() {
  var letters = '0123456789ABCDEF'.split('');
  var color = '#';
  for (var i = 0; i < 6; i++ ) {
      color += letters[Math.floor(Math.random() * 16)];
  }
  return color;
};
randomcolor = getRandomColor();
var helmet = document.getElementById('helmet');
helmet.setAttribute('style','fill:'+randomcolor);
helmet.id = 'helmet'+randomcolor;

var moto_body = document.getElementById('moto_body');
moto_body.setAttribute('style','fill:'+randomcolor);
moto_body.id = 'moto_body'+randomcolor;
